import React from "react";
import TaskDialog from "./TaskDialog";

function TaskTable() {
  return (
    <div>
      <h2 className="text-left mb-3">Frameworks</h2>
      <button className="btn btn-primary mb-3">Add</button>
      <table className="table table-bordered">
        <thead className="thead-dark">
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Deadline</th>
            <th>Priority</th>
            <th>Is Complete</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>{/* Table rows go here */}</tbody>
      </table>
      <TaskDialog />
    </div>
  );
}

export default TaskTable;
